import React from "react";

const SmallNav = () => {
  return (
    <div className="d-flex justify-content-between bg-primary container-fluid text-white fw-bold">
      <div className="">
        <p className="m-0 p-0 ">Hello</p>
      </div>
      <div>
        <p className="m-0 p-0">world</p>
      </div>
    </div>
  );
};

export default SmallNav;
